Note: I have added the helper function 'is_prime' to check if a number is prime. The 'all_right_truncatable_prime' function finds all right-truncatable prime numbers less than x by iterating from x-1 to 2, checking if each number is prime and if it remains prime when the last rightmost digit is successively removed. The resulting numbers are then sorted in descending order and returned.
